%%
%[text] ## Sarsa
% Sarsa ε-greedy 算法实现  deepseek写的
tic
% 初始化参数
% 注释掉break那一段就可以跑出稳定收敛的状态值
episode_count = 10000;  % 总回合数
Tlength = 1000;        % 每个回合的最大步数（防止无限循环）
gamma = 0.9;
epsilon = 0.3;  % ε-greedy参数

% 初始化数据结构
action_value = zeros(state_space, number_of_action);  % Q值函数，对应伪代码中的 q_t(s,a)

% 初始策略：均匀随机策略（ε-greedy）
policy = ones(state_space, number_of_action) * (1/number_of_action);

alpha = 0.1;  % 学习率

% 用于记录训练过程
episode_rewards = zeros(episode_count, 1);
episode_steps = zeros(episode_count, 1);

for episode = 1:episode_count
    % 初始化回合：在 s_0，根据 π(s_0)，得到 a_0
    agent_current_state = agent_state;
    
    % 使用 ε-greedy 策略选择初始动作
    % 注意：这里我们使用 action_value 来决定最优动作，但使用 policy 来采样
    agent_current_state_idx = stateCoord2Idx(agent_current_state, x_length);
    
    % 根据当前策略选择初始动作
    [a_idx, ~] = stochastic_policy(agent_current_state, action_space, policy, x_length, y_length);
    
    episode_reward = 0;
    
    % 执行回合，直到到达目标状态或达到最大步数
    for step = 1:Tlength
        % 收集经验样本 (s_t, a_t, r_{t+1}, s_{t+1}, a_{t+1})
        agent_current_state_idx = stateCoord2Idx(agent_current_state, x_length);
        
        % 执行动作 a_t，得到 r_{t+1}, s_{t+1}
        [agent_next_state, reward] = next_state_and_reward(agent_current_state, ...
            action_space{agent_current_state_idx}{a_idx}, x_length, y_length, final_state, ...
            obstacle_state, reward_forbidden, reward_target, reward_step);
        
        agent_next_state_idx = stateCoord2Idx(agent_next_state, x_length);
        
        % 检查是否到达目标状态 注释掉可求v_pi(si)
        if isequal(agent_next_state, final_state)
            % 到达目标，更新 Q 值后结束回合
            % Sarsa更新公式：q(s,a) = q(s,a) + α * (r + γ * q(s',a') - q(s,a))
            % 但注意目标状态是终止状态，没有下一个动作，所以 q(s',a') = 0
            td_target = reward;  % 目标状态，没有后续状态
            td_error = td_target - action_value(agent_current_state_idx, a_idx);
            action_value(agent_current_state_idx, a_idx) = action_value(agent_current_state_idx, a_idx) + alpha * td_error;

            episode_reward = episode_reward + reward;
            break;
        end
        
        % 根据 π_t(s_{t+1}) 生成 a_{t+1} (使用 ε-greedy)
        [a_idx_next, ~] = stochastic_policy(agent_next_state, action_space, policy, x_length, y_length);
        
        % 更新 Q 值：q(s,a) = q(s,a) + α * (r + γ * q(s',a') - q(s,a))
        % 这是一个低通滤波器
        td_target = reward + gamma * action_value(agent_next_state_idx, a_idx_next);
        td_error = td_target - action_value(agent_current_state_idx, a_idx);
        action_value(agent_current_state_idx, a_idx) = action_value(agent_current_state_idx, a_idx) + alpha * td_error;
        
        % 更新当前状态 s_t 的策略 (ε-greedy)
        % 找到当前状态下 Q 值最大的动作
        [max_q, a_star] = max(action_value(agent_current_state_idx, :));
        
        % 如果有多个动作具有相同的最大 Q 值，随机选择一个作为最优动作
        max_indices = find(action_value(agent_current_state_idx, :) == max_q);
        if length(max_indices) > 1
            a_star = max_indices(randi(length(max_indices)));
        end
        
        % 更新 ε-greedy 策略
        % 最优动作的概率：1 - ε + ε/|A(s)|
        % 其他动作的概率：ε/|A(s)|
        for a = 1:number_of_action
            if a == a_star
                policy(agent_current_state_idx, a) = 1 - epsilon + epsilon/number_of_action;
            else
                policy(agent_current_state_idx, a) = epsilon/number_of_action;
            end
        end
        
        % 状态转移：s_t ← s_{t+1}, a_t ← a_{t+1}
        agent_current_state = agent_next_state;
        a_idx = a_idx_next;
        
        episode_reward = episode_reward + reward;
        
        % 如果达到最大步数，结束回合
        % if step == Tlength
        %     fprintf('警告：回合 %d 达到最大步数 %d\n', episode, Tlength);
        % end
    end
    
    % 记录回合信息
    episode_rewards(episode) = episode_reward;
    episode_steps(episode) = step;
    
    % 可选：递减探索率 ε   其实很重要！
    epsilon = max(0.01, epsilon * 0.999);
    
    % % 每1000回合显示一次进度
    % if mod(episode, 1000) == 0
    %     avg_reward = mean(episode_rewards(max(1, episode-999):episode));
    %     avg_steps = mean(episode_steps(max(1, episode-999):episode));
    %     fprintf('回合 %d: 平均奖励=%.2f, 平均步数=%.2f\n', episode, avg_reward, avg_steps);
    % end
end

