% Sarsa ε-greedy 算法实现
tic
% 初始化参数
episode_count = 10000;  % 总回合数  如果是策略没有收敛，可能是迭代次数不够
Tlength = 100;
gamma = 0.9;
% ε对收敛效果影响也很大 epsilon不等于0会导致最终的每个v_pi(si)偏小
epsilon = 0.2;  % ε-greedy参数  %网格世界中，如果出现障碍物合围情况，可以调大epsilon以越过局部最优

% 初始化数据结构
% 对于每个状态-动作对，记录回报和访问次数
NumberTotal = zeros(state_space,number_of_action);  % 记录总访问次数
Q = zeros(state_space, number_of_action);       % 动作价值函数
V = zeros(state_space, 1);                      % 状态价值函数

% 初始策略：均匀随机策略
policy = ones(state_space, number_of_action) * (1/number_of_action);

action_value = zeros(state_space, length(actions));  % 只有网格世界这种简单的s-a关系的时候才能用上这种简单的数据结构
action_value_new = action_value;

alpha = 0.1;

for episode = 1:episode_count
    episodedebug = episode;  % 2025b的matlab 实时m文件debug的时候有bug...fuck
    agent_current_state = agent_state;
    [a_idx0, a0] = stochastic_policy(agent_current_state, action_space, policy, x_length, y_length);
    a_idx = a_idx0;
    % while (agent_current_state(1) ~= final_state(1)) || (agent_current_state(2) ~= final_state(2))  % agent没有到达最终目标位置
    for step = 1:Tlength
        % sarsa 样本生成
        agent_current_state_idx = stateCoord2Idx(agent_current_state, x_length);
        [agent_next_state, reward] = next_state_and_reward(agent_current_state, ...
            action_space{agent_current_state_idx}{a_idx}, x_length, y_length, final_state, ...
            obstacle_state, reward_forbidden, reward_target, reward_step);

        [a_idx_next, ~] = stochastic_policy(agent_next_state, action_space, policy, x_length, y_length);
        
        % 向所激活的低通滤波器中输入样本
        agent_next_state_idx = stateCoord2Idx(agent_next_state, x_length);
        
        action_value_new(agent_current_state_idx, a_idx) = action_value(agent_current_state_idx, a_idx) - alpha*(action_value(agent_current_state_idx, a_idx) - (reward + gamma*action_value(agent_next_state_idx,a_idx_next)));
        action_value = action_value_new;

        % 更新策略
        [~, a_star] = max(action_value(agent_current_state_idx, :));
        % 计算ε-greedy策略
        for a = 1:number_of_action
            if a == a_star
                policy(agent_current_state_idx, a) = 1 - epsilon * (number_of_action - 1) / number_of_action;
